INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES (1, 0, 19812029, 11, 1, 103011, "シュバババババ～♪\n忍法に不可能はありまセン！\nウキヨエを壁に描くのも\nお手の物デス！", 10, 0, 0.5, 19812);
