INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES (1, 0, 19812044, 11, 1, 104511, "そ、そうですね……\nドＳさんも多種多様な攻めを\n繰り出してきますけど、全部\nクウカにとっては快感ですし。", 10, 0, 0.5, 19812);
