INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES (1, 0, 28412022, 11, 1, 100511, "これでバッチリッス！\nどうッスか？\nトラタイガーみたいにかっこよく\n描けてるんじゃないッスかね？", 10, 0, 0.5, 28412);
