INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES (1, 0, 28412027, 11, 1, 103711, "ふふっ、そうだね。\n君の憧れてるヒーローみたいに\nちゃんと描けてるよ。\n……一時はどうなるかと思ったけど。", 10, 0, 0.5, 28412);
